    let increment = () => {
      setCount(count + 1);
    };
    let decrement = () => {
      setCount(count + 1);
    };
    return (
      <div>

        <main>
          <h2>Welcome to the homepage!</h2>
          <p>You can do this, I believe in you.</p>
          <Table />
        </main>

      </div>
    );
  }


  type Pages = [pageData];
class Table extends React.Component{
  state: {pages: Pages}
  constructor(props: any){
    super(props)
    let p = [] as never
    this.state = {pages: p}
  }

  render(): React.ReactNode {
    fetch("/getall").then((data) => {
      alert(data.body)
      let unmarshalled = JSON.parse(data.body as any) //data.body as any
      this.setState({pages: unmarshalled})
      console.log(data.body)
    }, () => {alert("request failed")})
    return <table><tr><td>test</td></tr></table>
  }
}
